import React, { Component } from "react";
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';
import { Redirect } from 'react-router-dom';
import { Link } from 'react-router-dom';

class BuyerSignUp extends Component {
    // postLogins = function () {
    //     this.props.postLogin().then(
    //         () => {
    //             this.props.history.push("/profile");
    //         }
    //     )
    // };

    render() {
        return (
            <article class="card-body">
                <h4 class="card-title mb-4 mt-1"><strong>Sign Up as Buyer</strong></h4>
                <form>
                    <div class="form-row">
                        <div class="col-12 col-md-6 form-group">
                            <label>Username</label>
                            <input type="text" class="form-control" placeholder="" />
                        </div>
                        <div class="col-12 col-md-6 form-group">
                            <label>Create password</label>
                            <input class="form-control" type="password" />
                        </div>
                    </div>
                    <div class="form-group">
                        <label>Full name</label>
                        <input type="text" class="form-control" placeholder="" />
                    </div>
                    <div class="form-row">
                        <div class="col-12 col-md-6 form-group">
                            <label>Email</label>
                            <input type="email" class="form-control" placeholder="" />
                        </div>
                        <div class="col-12 col-md-6 form-group">
                            <label>Contact Number</label>
                            <input type="number" class="form-control" placeholder="" />
                        </div>
                    </div>
                    <div class="form-group">
                        <label>Address</label>
                        <input type="text" class="form-control" />
                    </div>
                    <div class="form-group">
                        <button type="submit" class="btn blue-btn btn-block"> Register </button>
                    </div>
                    <small class="text-muted">By clicking the 'Register' button, you confirm that you
                        accept our Terms of use and Privacy Policy.</small>
                </form>
                <div class="border-top card-body text-center">Have an account? <a href="">Sign In</a></div>

            </article>

        );
    }
}

export default withRouter(BuyerSignUp);
